import "./App.css";
import Navbar from './Components/layout/Navbar'
import Users from './Components/users/Users'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar title = 'Github Finder'/>
        .container

        <Users />
      </div>
    );
  }
}

export default App;
